import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import LForm from '../components/LForm'



const styles = {
  Default: {
    display: 'inline',
    textAlign: 'center',
    justifyContent: 'center',
    alignItems: 'center',
  },
  Frame: {
    borderStyle: 'solid',
    borderWidth: '1px',
    borderRadius: '5px',
    padding: '10px',
    margin: '10px',
    width: '40%'

  }

}

export default function Login() {
  return (
    <Container style={styles.Default}>  
      <Row></Row>    
      <Row>
        <Col></Col>
        <Col  style={styles.Frame}>          
          <LForm />
        </Col>
        <Col></Col>
      </Row>
    </Container>
  )
};
